Which is the graph of y = 2f(x)?

[asy]
unitsize(0.5 cm);

picture[] graf;
int i, n;

real func(real x) {
  real y;
  if (x >= -2 && x <= 1) {y = x + 1;}
  if (x >= 1 && x <= 3) {y = -(x - 1)^2 + 2;}
  if (x >= 3 && x <= 5) {y = -2*(x - 4) + 1;}
  return(y);
}

real f2(real x) {return 2*func(x);}
real fh(real x) {return 0.5*func(x);}
real fshift(real x) {return func(x) + 2;}
real fshift2(real x) {return func(x) - 2;}
real freflect(real x) {return -func(x);}

for (n = 1; n <= 5; ++n) {
  graf[n] = new picture;
  for (i = -5; i <= 5; ++i) {
    draw(graf[n],(i,-5)--(i,5),gray(0.7));
    draw(graf[n],(-5,i)--(5,i),gray(0.7));
  }
  draw(graf[n],(-5,0)--(5,0),Arrows(6));
  draw(graf[n],(0,-5)--(0,5),Arrows(6));

  label(graf[n],"$x$", (5,0), E);
  label(graf[n],"$y$", (0,5), N);
}

draw(graf[1],graph(f2,-2,5),red);
draw(graf[2],graph(fh,-2,5),red);
draw(graf[3],graph(fshift,-2,5),red);
draw(graf[4],graph(fshift2,-2,5),red);
draw(graf[5],graph(freflect,-2,5),red);

label(graf[1], "A", (0,-6));
label(graf[2], "B", (0,-6));
label(graf[3], "C", (0,-6));
label(graf[4], "D", (0,-6));
label(graf[5], "E", (0,-6));

add(graf[1]);
add(shift((12,0))*(graf[2]));
add(shift((24,0))*(graf[3]));
add(shift((6,-12))*(graf[4]));
add(shift((18,-12))*(graf[5]));
[/asy]

